def max_len_sub(arr, n):
    """
    Finds the maximum length of the subsequence with difference between adjacent elements for the given array.

    Args:
      arr: The input array.
      n: The length of the array.

    Returns:
      The maximum length of the subsequence with difference between adjacent elements.
    """
    if not arr:
        return 0

    max_len = 0
    for i in range(1 << n):
        subsequence = []
        for j in range(n):
            if (i >> j) & 1:
                subsequence.append(arr[j])

        if len(subsequence) > 0:
            is_valid = True
            for k in range(len(subsequence) - 1):
                if subsequence[k] >= subsequence[k+1]:
                    is_valid = False
                    break

            if is_valid:
                max_len = max(max_len, len(subsequence))

    return max_len
```

