    Finds the n-th number in the Newman-Comeway sequence.

    The Newman-Comeway sequence is defined as follows:
    1 -> 1 -> 2 -> 1 -> 2 -> 3 -> 1 -> 2 -> 3 -> ...

    Args:
        n: The index of the number to find (1-based).

    Returns:
        The n-th number in the sequence.
    """
    if n == 1:
        return 1
    elif n == 2:
        return 1
    elif n == 3:
        return 2
    elif n == 4:
        return 3
    elif n == 5:
        return 1
    elif n == 6:
        return 2
    elif n == 7:
        return 3
    elif n == 8:
        return 1
    elif n == 9:
        return 2
    elif n == 10:
        return 3
    else:
        return sequence(n - 1)
