def common_in_nested_lists(nestedlist) -> list:
    """
    Finds common elements in given nested lists.

    Args:
        nestedlist (list): A list of lists.

    Returns:
        list: A list of common elements.
    """
    if not nestedlist:
        return []

    common = []
    for sublist in nestedlist:
        if not sublist:
            continue
        current_common = set(sublist)
        for item in sublist:
            if set(item).issubset(current_common):
                current_common.update(item)
        if current_common:
            common.append(current_common)

    return list(set(common))
