def assign_freq(test_list):
    """Assigns frequency to each tuple in the given tuple list.

    Args:
        test_list: A list of tuples.

    Returns:
        A list of tuples, where each tuple contains the frequency of the
        corresponding tuple in the input list.
    """
    freq_list = []
    for tup in test_list:
        freq = {}
        for element in tup:
            if element in freq:
                freq[element] += 1
            else:
                freq[element] = 1
        for key, value in freq.items():
            freq_list.append((key, value))
    return freq_list
