def reverse_vowels(str1):
    vowels = "aeiouAEIOU"
    str1 = str1.lower()
    vowel_indices = []
    vowel_list = []

    for i, char in enumerate(str1):
        if char in vowels:
            vowel_indices.append(i)
            vowel_list.append(char)

    vowel_list.reverse()

    result = list(str1)
    for i, index in enumerate(vowel_indices):
        result[index] = vowel_list[i]

    return "".join(result)
