def hexagonal_num(n):
    """
    This function calculates the nth hexagonal number.

    Args:
        n: The index of the hexagonal number to calculate (positive integer).

    Returns:
        The nth hexagonal number.
    """
    if n < 1:
        return 0  # Handle invalid input (n must be positive)
    return n * (2 * n - 1)
