def count_samepair(list1,list2,list3) -> int:
    """
    Given three lists, return the number of times a pair of elements appears in all three lists.
    For example:
    count_samepair([1,2,3],[2,2,4],[1,3,3]) == 2
    count_samepair([1,2,3],[1,2,4],[1,3,5]) == 0
    """
    count1 = 0
    count2 = 0
    count3 = 0
    for num in list1:
        if num in list2 and num in list3:
            count1 += 1
    for num in list2:
        if num in list1 and num in list3:
            count2 += 1
    for num in list3:
        if num in list1 and num in list2:
            count3 += 1
    return count1 + count2 + count3
```

