    Verifies the validity of a string of parentheses.

    Args:
        str1: The string to check.

    Returns:
        True if the string is valid, False otherwise.
    """
    stack = []
    parenthesis_map = {')': '(', '}': '{', ']': '['}

    for char in str1:
        if char in parenthesis_map.values():
            stack.append(char)
        elif char in parenthesis_map.keys():
            if not stack or stack[-1] != parenthesis_map[char]:
                return False
            stack.pop()
        else:
            continue

    return not stack
```

