    """
    Counts the number of prime numbers less than a given non-negative number.

    Args:
        n: A non-negative integer.

    Returns:
        The number of prime numbers less than n.
    """
    if n <= 2:
        return 0

    is_prime = [True] * n
    is_prime[0] = is_prime[1] = False

    for i in range(2, int(n**0.5) + 1):
        if is_prime[i]:
            for j in range(i*i, n, i):
                is_prime[j] = False

    return sum(is_prime)
