def count_binary_seq(n):
    """
    Finds the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.

    Args:
        n: An integer representing half the length of the binary sequence.

    Returns:
        An integer representing the number of such binary sequences.
    """
    if n < 0:
        return 0

    def is_binary_seq(seq):
        """
        Checks if a sequence is a valid binary sequence.
        """
        for i in range(len(seq) - 1):
            if seq[i] != '0' or seq[i+1] != '1':
                return False
        return True

    def calculate_sum(seq):
        """
        Calculates the sum of the bits in a sequence.
        """
        sum_bits = 0
        for bit in seq:
            sum_bits += int(bit)
        return sum_bits

    count = 0
    for i in range(2**n):
        seq = []
        for j in range(n):
            if (i >> j) & 1:
                seq.append(str(j))
        if is_binary_seq(seq):
            sum_n = calculate_sum(seq)
            sum_n_last = calculate_sum(seq[::-1])
            if sum_n == sum_n_last:
                count += 1

    return count
