    """
    Minimize the length of the string by removing occurrence of only one character.

    For example:
    minimum_Length("abcabc") == "abc"
    minimum_Length("aabbcc") == "abc"
    minimum_Length("abc") == "abc"
    """
    if not s:
        return ""

    counts = {}
    for char in s:
        counts[char] = counts.get(char, 0) + 1

    chars_to_remove = []
    for char, count in counts.items():
        if count == 1:
            chars_to_remove.append(char)

    if not chars_to_remove:
        return s

    result = ""
    for char in s:
        if char not in chars_to_remove:
            result += char

    return result
