def is_tree_balanced(root) -> bool:
    """
    Checks if a binary tree is balanced.

    A binary tree is balanced if for every node, the difference in height
    between its left and right subtrees is not more than 1.

    Args:
        root: The root node of the binary tree.

    Returns:
        True if the binary tree is balanced, False otherwise.
    """

    def get_height(node):
        if not node:
            return 0
        return 1 + max(get_height(node.left), get_height(node.right))

    def is_balanced_helper(node):
        if not node:
            return True

        left_height = get_height(node.left)
        right_height = get_height(node.right)

        if abs(left_height - right_height) > 1:
            return False

        return is_balanced_helper(node.left) and is_balanced_helper(node.right)

    return is_balanced_helper(root)
