def Find_Max(lst):
    """
    Finds the sublist having the maximum length in a given list.

    Args:
        lst: A list of numbers.

    Returns:
        A tuple containing the maximum length and the sublist itself.
        Returns (0, []) if the input list is empty.
    """
    if not lst:
        return (0, [])

    max_len = 0
    max_sublist = []

    for i in range(len(lst)):
        for j in range(i, len(lst)):
            sublist = lst[i:j+1]
            if len(sublist) > max_len:
                max_len = len(sublist)
                max_sublist = sublist

    return (max_len, max_sublist)
```

